Bride Flight (2008)
Alternatieve titel: Bruidsvlucht 

Nederland
Drama / Romantiek
120 minuten

geregisseerd door Ben Sombogaart
met Karina Smulders, Waldemar Torenstra en Anna Drijver

De film vertelt het verhaal van drie jonge bruiden Ada, Marjorie en Esther en avonturier Frank. Zij ontmoeten elkaar in 1953 tijdens de beroemde luchtrace van Londen naar Nieuw-Zeeland. Hun levens zullen altijd verbonden blijven.

